<body class="<?php if ($_FILES['userfile']['error']['0'] == 0){echo "check";}else{echo "error";}?>">
  <a href="http://<? echo $_SERVER["SERVER_ADDR"] ?>:8080">Вернуться на главную</a>
<?php

$uploaddirectory = 'uploads/';
$saved = array(
  "success" => 0,
  "renamed" => 0,
  "errNS" => 0,
  "errS" => 0,
);

$counter_loaded_files = count($_FILES['userfile']['name']);
for($i = 0; $i<$counter_loaded_files; $i++){
  
  $current_file_array['userfile'] = array(
      "name"=>mb_convert_case($_FILES['userfile']['name'][$i], MB_CASE_LOWER, "UTF-8"),
      "type"=>$_FILES['userfile']['type'][$i],
      "tmp_name"=>$_FILES['userfile']['tmp_name'][$i],
      "error"=>$_FILES['userfile']['error'][$i],
      "size"=>$_FILES['userfile']['size'][$i]);

  $uploadfile = $uploaddirectory . basename($current_file_array['userfile']['name']);

      //Проверим существует ли такой же файл
      if (file_exists($uploadfile)){
          $uploadfile = $uploaddirectory . "re_" . basename($current_file_array['userfile']['name']);
          if (move_uploaded_file($current_file_array['userfile']['tmp_name'], $uploadfile)) {
              //echo "Файл успешно загружен с приставкой \"re_\".\n";
            $saved['renamed']++;
          } else {
              //echo "Ошибка! Файлы не были выбраны.\n";
            $saved['errNS']++;
          }
      }else{
          if (move_uploaded_file($current_file_array['userfile']['tmp_name'], $uploadfile)) {
              //echo "Файл успешно загружен.\n";
            $saved['success']++;
          } else {
              echo "Ошибка сохранения файла!\n";
            $saved['errS']++;
          }
      }

}

echo '<p> Обработано: ' . $saved['success'] . ' - успешно,  '. $saved['renamed'] . ' - успешно с переименованием, ' . ($saved['errNS'] + $saved['errS']) . ' - неуспешно.</p>';
/*
echo 'Некоторая отладочная информация:';
print_r($_FILES);
*/
//Комментарий ошибки
if ($_FILES['userfile']['error'] == 0){
  //echo "Ошибок не возникло, файл был успешно загружен на сервер";
}
elseif ($_FILES['userfile']['error'] == 1){
  echo "Размер принятого файла превысил максимально допустимый размер, который задан директивой upload_max_filesize конфигурационного файла php.ini.";
}
elseif ($_FILES['userfile']['error'] == 2){
  echo "Размер загружаемого файла превысил значение MAX_FILE_SIZE, указанное в HTML-форме.";
}
elseif ($_FILES['userfile']['error'] == 3){
  echo "Загружаемый файл был получен только частично.";
}
elseif ($_FILES['userfile']['error'] == 4){
  echo "Файл не был загружен.";
}
elseif ($_FILES['userfile']['error'] == 6){
  echo "Отсутствует временная папка. Добавлено в PHP 5.0.3.";
}
elseif ($_FILES['userfile']['error'] == 7){
  echo "Не удалось записать файл на диск. Добавлено в PHP 5.1.0.";
}
elseif ($_FILES['userfile']['error'] == 8){
  echo "PHP-расширение остановило загрузку файла. PHP не предоставляет способа определить какое расширение остановило загрузку файла; в этом может помочь просмотр списка загруженных расширений из phpinfo(). Добавлено в PHP 5.2.0.";
}
